import React, {useCallback, useEffect} from 'react'
import { useDispatch, useSelector } from 'react-redux'
import {showRenewHistory} from "../redux/actions/actions";

const History = () => {
  const state = useSelector((counter) => counter.num.history)
  const dispatch = useDispatch()

  useEffect(() => {
    dispatch(showRenewHistory())
  }, [])

  const rerender = useCallback(() => {
    if (state.length === 0) return <div>История пуста</div>
    return state.map((value) => (
      <div>
        {value}
      </div>
    ))
  }, [state])

  return (
    <div>
      {rerender()}
    </div>
  )
}

export default History
